import React from "react";
import Table from "react-bootstrap/Table";

const AccountsList = ({ users }) => {
  const userInfo = () => {
    return users.map((user) => [
      // <a href="#">
      <tr>
        <a href={user.code}>
          <td>{user.code}</td>
        </a>
        <td>{user.last_four}</td>
        <td>{user.first_name}</td>
        <td>{user.last_name}</td>
        <td>{user.phone_num}</td>
        <td>{user.email}</td>
        <td>{user.transactions.length}</td>
      </tr>,
      // </a>
    ]);
  };
  console.log(users);

  return (
    <>
      <h1>Clients</h1>
      <Table striped hover>
        <thead>
          <tr>
            <th>QR Code</th>
            <th>User ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Phone</th>
            <th>Email</th>
            <th>Transactions</th>
          </tr>
        </thead>
        <tbody>{userInfo()}</tbody>
      </Table>
      <ol></ol>
    </>
  );
};

// UserList.propTypes = {
//     users: PropTypes.array.isRequired,
// };

export default AccountsList;
